import './App.css';

class CompClass extends React.Component {
  helpText = 'Help text'
  render() {
    return (
      <header>{this.props.xInfo}
        <h2 onClick={this.mouseOver}>
          {this.helpText}</h2>
      </header>
    )
  }
  mouseOver() { console.log('Mouse over') }
}

function App() {
  return (
    <div className="App">
      <header className="App-header">
        hello
      </header>
    </div>
  );
}

export default App;
